import Image from "next/image";
import Banner1 from "@/assets/contact/tphcm.jpg";

export default function Banner() {
  return (
    <div className="relative w-full h-[300px]">
      {/* Background Image */}
      <Image
        alt="Banner Bottom"
        src={Banner1}
        fill
        priority
        className="w-full h-full object-cover"
      />

      
    </div>
  );
}
